import { Component, OnInit } from '@angular/core';
import { ShowingService } from '../services/showing.service';

@Component({
  selector: 'app-list-showing',
  templateUrl: './list-showing.component.html',
  styleUrls: ['./list-showing.component.css']
})
export class ListShowingComponent implements OnInit {

  constructor(showingService : ShowingService){}

  ngOnInit(): void {
    try{

      let idSche = Number(this.route.snapshot.paramMap.get('idS'));
      //let idPat = Number(this.route.snapshot.paramMap.get('idP'));

      //this.getPatient(idPat);
      this.getScheduleById(idSche);


    }catch(e){
      console.log("error: "+ e);
    }

  }

}
